import * as FaIcons from 'react-icons/fa';

export default [
    {
        question: 'Why should I use OOVEST platform?',
        answer: 'By using OOVEST platform, not only you can use your other exchange wallet, but also you have a platform with lots of different tools to help you trade more profitable.',
        icon: <FaIcons.FaUserFriends/>
    },
    {
        question: 'Should I buy OOVEST account?',
        answer: 'No, OOVEST basic facilities are free, but for using some robots or buying customized robots from other users you should pay.',
        icon: <FaIcons.FaCommentDollar/>  
    },
    {
        question: 'Can I use OOVEST platform without signing up?',
        answer: 'Well, you can see some public pages in dashboard but for using full freatures you should register in OOvest.',
        icon: <FaIcons.FaQuestion/>
    }
]
